import React from "react";
import moment from "moment";

const MyMemo = () => {
  const getLength = (w) => {
    console.log(
      "getLength() 호출됨! :::: " + moment().format("YY/MM/DD hh:mm:ss:ms")
    );
    return w.length;
  };

  return (
    <div>
      <h2>MyMemo</h2>
    </div>
  );
};

export default MyMemo;
